import React from 'react';
import './App.css';

import { ClienteClient } from "./"

var client = new ClienteClient('http://localhost:8000')

function handlerClient(){
  client.getCliente({id:"1"}, (e, r) => console.log(e, r));
}
function App() {


  return (
    <div>
      <button onClick={handlerClient()}>Clickeame</button>
    </div>
  );
}

export default App;
